"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H16326120\">",
"      <span class=\"h1\">",
"       What is a bunion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A bunion is a bony bump on the joint at the base of your big toe (",
"      <a class=\"graphic graphic_figure graphicRef72906 \" href=\"UTD.htm?16/28/16847\">",
"       figure 1",
"      </a>",
"      ). It happens when your big toe points toward your second toe.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16326135\">",
"      <span class=\"h1\">",
"       What are the symptoms of a bunion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A bony bump on the joint at the base of the big toe",
"       </li>",
"       <li>",
"        Pain around the big toe joint",
"       </li>",
"       <li>",
"        Trouble moving the big toe",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Your big toe might also turn red and swollen. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16326150\">",
"      <span class=\"h1\">",
"       Is there a test for a bunion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Your doctor or nurse should be able to tell if you have it by learning about your symptoms and doing an exam. But you might need an X-ray to see if the joint in your toe is damaged.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16326165\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You might feel better if you:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Wear wide, low-heeled shoes, or special shoes designed to have extra space around the big toe.",
"       </li>",
"       <li>",
"        Do stretching exercises &ndash; This helps the toe and foot joints move better.",
"       </li>",
"       <li>",
"        Wear a bunion pad &ndash; This is a small cushion that keeps the big toe from rubbing against your shoe.",
"       </li>",
"       <li>",
"        Put a cold gel pack, bag of ice, or bag of frozen vegetables on the bunion for 20 to 30 minutes after exercising. Put a thin towel between the ice (or other cold object) and your skin.",
"       </li>",
"       <li>",
"        Take medicine to reduce the pain, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"         acetaminophen",
"        </a>",
"        (brand name: Tylenol&reg;) or",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil&reg;, Motrin&reg;)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16326180\">",
"      <span class=\"h1\">",
"       How is a bunion treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If the treatments you have tried on your own don&rsquo;t help, you doctor might refer you to a foot doctor, called a &ldquo;podiatrist.&rdquo; A podiatrist can fit you with:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A special shoe insert (called an &ldquo;orthotic&rdquo;) to align and support your toe during the day.",
"       </li>",
"       <li>",
"        A foot splint to help to straighten the toe at night while you sleep (",
"        <a class=\"graphic graphic_picture graphicRef51796 \" href=\"UTD.htm?1/32/1537\">",
"         picture 1",
"        </a>",
"        ). &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you have severe pain or trouble walking, your doctor can refer you to a foot surgeon. There are many different types of surgery to realign the toe and remove the bony bump of a bunion.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16326195\">",
"      <span class=\"h1\">",
"       Can a bunion be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You might be less likely to get a bunion if you avoid wearing shoes that squeeze or put pressure on your toes.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13526910\">",
"      <span class=\"h1\">",
"       More on this topic",
