"     Patient information: Knee replacement (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/knee-replacement-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1717207\">",
"      <span class=\"h1\">",
"       What is knee replacement?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Knee replacement is a type of surgery in which a doctor replaces parts of a person&rsquo;s knee joint with man-made parts.",
"     </p>",
"     <p>",
"      The knee joint is made up of the lower part of the thigh bone, the knee cap, and the top part of the lower leg bone (",
"      <a class=\"graphic graphic_figure graphicRef57878 \" href=\"UTD.htm?17/11/17584\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      When people have problems with their knee joint, the knee can be painful, swollen, stiff, or have trouble moving normally. Different conditions can cause problems with the knee joint. One of the most common causes is osteoarthritis, a type of arthritis that often comes with age.",
"     </p>",
"     <p>",
"      Knee replacement is a treatment that can reduce knee pain and improve the way the knee works.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717214\">",
"      <span class=\"h1\">",
"       When are knee problems treated with knee replacement?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Knee problems might or might not be treated with knee replacement right away. Doctors sometimes suggest trying other treatments first. These can include weight loss, medicines, knee braces, or physical therapy. If these treatments do not help enough, doctors then suggest knee replacement.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717221\">",
"      <span class=\"h1\">",
"       What happens during knee replacement surgery?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Knee replacement takes place in an operating room in a hospital. A doctor will give you medicines to make you sleep and to numb your body. Then your doctor will make a cut down the center on the front of the knee. He or she will replace parts of your knee joint with man-made parts made out of metal, ceramic, or plastic.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717228\">",
"      <span class=\"h1\">",
"       What happens after surgery?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After surgery, most people stay in the hospital for 2 to 4 days. While you are in the hospital, you will get:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines to treat your pain",
"       </li>",
"       <li>",
"        Antibiotic medicines to prevent infections",
"       </li>",
"       <li>",
"        Medicines to prevent blood clots in the legs",
"       </li>",
"       <li>",
"        Special boots or stockings to prevent blood clots in the legs",
"       </li>",
"       <li>",
"        Physical therapy &ndash; Most people are able to stand and walk (with help) within 1 day after surgery. The physical therapist will teach you exercises to make the muscles in your leg stronger. He or she will also work with you on bending, walking, and climbing stairs so that you can move normally.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717235\">",
"      <span class=\"h1\">",
"       What problems can people have from knee replacement?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People can have different problems right after knee replacement surgery, but serious problems are uncommon. Problems from knee replacement can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood clots in the legs &ndash; This can cause leg pain and swelling.",
"       </li>",
"       <li>",
"        Infections &ndash; Symptoms of an infection can include fever, chills, pain in the knee that gets worse and worse, or knee swelling.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you have any of these symptoms, let your doctor or nurse know.",
"     </p>",
"     <p>",
"      People who have a knee replaced sometimes find that the new knee is stiff and does not bend as well as their own knee used to. This can make it hard to climb stairs or get up from a low chair.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717242\">",
"      <span class=\"h1\">",
"       Where do I go after I leave the hospital?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many people go home. But some people stay in a nursing home or rehabilitation facility for a short time in order to get stronger before going home. Wherever you go, you will need to do your exercises and have physical therapy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717249\">",
"      <span class=\"h1\">",
"       When will I be able to do my usual activities again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people can do their usual activities again within 3 to 6 weeks of knee replacement. Your doctor or nurse will tell you if there are any activities that you should avoid.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717256\">",
"      <span class=\"h1\">",
"       How do I know if knee replacement is right for me?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To help you decide if knee replacement is right for you, talk with your doctor or nurse. You can ask him or her:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        What are the benefits of knee replacement?",
"       </li>",
"       <li>",
"        What are the downsides to knee replacement?",
"       </li>",
"       <li>",
"        Are there other options besides knee replacement?",
"       </li>",
"       <li>",
"        What happens if I do not have knee replacement?",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1717263\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?42/3/43058?source=see_link\">",
"       Patient information: Osteoarthritis (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?16/31/16883?source=see_link\">",
