"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?12/44/12998?source=see_link\">",
"       Patient information: Deep vein thrombosis (DVT) (Beyond the Basics)",
"      </a>",
"     </p>",
