var title_f28_50_29478="Orthodromic AVRT tutorial";
var content_f28_50_29478=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F54720&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F54720&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1046px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electrocardiogram (ECG) showing orthodromic atrioventricular reentrant tachycardia (AVRT)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 343px; height: 92px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Atrioventricular reentrant tachycardia (AVRT)&nbsp;is a supraventricular tachycardia associated with an accessory pathway connection between the atria and ventricles. The pathway may conduct antegrade only, retrograde only, or bith antegrade and retrograde.&nbsp;AVRT is usually initiated by an atrial premature beat (arrow). The most common type of AVRT, termed orthodromic AVRT,&nbsp;uses the AV node and His Purkinje system (which has a relatively short refractory period) for antegrade conduction to the ventricles and the accessory AV pathway (which in these patients has a relatively long antegrade refractory period when compared to the node) for retrograde conduction. During orthodromic AVRT, QRS complexes are narrow. During sinus rhythm, however, wide and bizarre QRS complexes (indicative of the WPW pattern) are caused by conduction over both the accessory and normal pathways, resulting in a fusion beat. Since there is 1:1 retrograde activation of the atrium, a negative P wave may be present following the QRS complex.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 456px\">",
"   <div class=\"ttl\">",
"    Sinus rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 103px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The normal P wave in sinus rhythm is slightly notched since activation of the right atrium precedes that of the left atrium. The P wave is upright in a positive direction in leads I and II. A P wave with a uniform morphology precedes each QRS complex. The rate is between 60 and 100 beats per minute and the cycle length is uniform between sequential P waves and QRS complexes. In addition, the P wave morphology and PR intervals are identical from beat to beat.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
