var title_f28_50_29483="Lipids - Standard vs SI units";
var content_f28_50_29483=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F76734&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F76734&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cholesterol and triglyceride measurements in the United States and elsewhere",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        <p>",
"         Measurement used within the United States",
"         <br/>",
"         Milligrams/deciliter (mg/dL)",
"        </p>",
"       </td>",
"       <td class=\"subtitle1\">",
"        <p>",
"         Measurement used most places outside the United States",
"         <br/>",
"         Millimoles/liter (mmol/Liter)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Level to aim for",
"       </td>",
"       <td class=\"subtitle2\">",
"        Level to aim for",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Total cholesterol",
"        </strong>",
"       </td>",
"       <td>",
"        Below 200",
"       </td>",
"       <td>",
"        Below 5.17",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         LDL cholesterol",
"        </strong>",
"       </td>",
"       <td>",
"        Below 130 - or much lower if at risk of heart attack and stroke",
"       </td>",
"       <td>",
"        Below 3.36 - or much lower if at risk of heart attack and stroke",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         HDL cholesterol",
"        </strong>",
"       </td>",
"       <td>",
"        Above 60",
"       </td>",
"       <td>",
"        Above 1.55",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Triglycerides",
"        </strong>",
"       </td>",
"       <td>",
"        Below 150",
"       </td>",
"       <td>",
"        Below 1.7",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Cholesterol is measured differently in the United States than it is in most other countries. This table shows values used within and outside the United States. It includes the cholesterol and triglyceride levels that most people who do not have heart disease should aim for.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
