var title_f28_50_29484="Indications for pulmonary tests";
var content_f28_50_29484=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F52884&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F52884&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications for pulmonary function tests",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Test",
"       </td>",
"       <td class=\"subtitle1\">",
"        Indication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Spirometry",
"       </td>",
"       <td>",
"        Evaluate dyspnea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Symptomatic smokers over age 45 to detect COPD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monitor recovery from exacerbation of asthma, COPD",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Spirometry with bronchodilator",
"       </td>",
"       <td>",
"        Chronic cough or chest tightness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Suspected asthma or COPD",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\" rowspan=\"6\">",
"        <p>",
"         Diffusing capacity for carbon monoxide",
"        </p>",
"        <p>",
"         (DLCO or transfer factor)",
"        </p>",
"       </td>",
"       <td>",
"        Differential diagnosis of abnormal spirometry",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obstruction: asthma versus COPD or bronchiolitis obliterans",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Restriction: interstitial lung disease versus chest wall",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diffuse opacities on chest radiograph",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Suspected pulmonary vascular disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Evaluate dyspnea",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Lung volumes",
"       </td>",
"       <td>",
"        Low FVC on spirometry: restriction versus hyperinflation or mixed",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Oximetry with exercise or sleep",
"       </td>",
"       <td>",
"        Dyspnea on exertion, disability evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Check adequacy of supplemental oxygen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Screen for abnormal breathing during sleep",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Bronchoprovocation challenge",
"       </td>",
"       <td>",
"        Suspected asthma but normal spirometry",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Respiratory pressures",
"       </td>",
"       <td>",
"        Suspected muscle weakness or diaphragm paralysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monitoring of myasthenia, ALS, polio",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist1_start\" rowspan=\"3\">",
"        Flow volume loop",
"       </td>",
"       <td>",
"        Inspiratory stridor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Suspected upper airway obstruction: vocal cord paralysis, tracheal stenosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Evaluate unexplained dyspnea",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     COPD: chronic obstructive pulmonary disease; FVC: forced vital capacity; ALS: amyotrophic lateral sclerosis.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
